INSERT INTO `jbl-auto-lautsprecher` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (2, '../img/products/JBL-Auto-Lautsprecher/JBL GX602.webp;', 'JBL GX602', 'https://www.amazon.de/JBL-GX602-Lautsprecher-180-Watt-2-Wege-Schwarz/dp/B00MUKMYNY/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=1B9BEVCITPUNK&keywords=JBL+GX602&qid=1667238915&qu=eyJxc2MiOiIyLjA0IiwicXNhIjoiMS4yMCIsInFzcCI6IjAuNzMifQ%3D%3D&sprefix=%2Caps%2C143&sr=8-3', '74,90', 4.5, 780, 1, 'JBL;Flush Montage;-;Woofer;-;2.0, 2.3;JBL Lautsprecher Auto GX 602 sind hocheffizient und leistungsstark, liefern einen großen Sound und sind die ideale Aufrüstung für jedes Hifi Auto Soundsystem, sogar bei ein werkseitig eingebautes Autoradio mit geringer Leistung|Mit niederohmigen 3 Ohm-Schwingspulen können die JBL Autolautsprecher der GX-Serie mehr Leistung aus dem Verstärker ziehen als herkömmliche Lautsprecher Boxen, was für den Hörer einen klareren, satteren Klang bedeutet|Harman's Plus One-bassbox-membran-Technologie bietet eine größere Box-Membranoberfläche an JBL Speaker als andere Auto Boxen, das für höhere Empfindlichkeit, ein besseres Tieffrequenzverhalten und detailreicheren Bass Wiedergabe Ihrer Musik sorgt|JBL GX Autoboxen haben dank ausgewogenen Soft Dome Hochtöner eine sanfte Hochtonwiedergabe und eine höhere Belastbarkeit für Höhen und Mitten, was zu einem lebensechteren Klang von Gesang, Becken, Blechblasinstrumenten und Klavieren führt|Harman testet JBL Boxen und setzt sie extremen Bedingungen aus, die übliche Lautsprecher zerstören würden. JBL friert sie ein, backt sie, schüttelt sie, bestrahlt sie mit ultraviolettem Licht und treibt sie tagelang mit voller Leistung an');
INSERT INTO `jbl-auto-lautsprecher` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (3, '../img/products/JBL-Auto-Lautsprecher/JBL Stage 39637.webp;', 'JBL Stage 39637', 'https://www.amazon.de/JBL-Stage3-637F-3-Wege-Lautsprecher/dp/B0B7629D6K/ref=sr_1_1?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=1XDWX708HSZ94&keywords=JBL+Stage+39637&qid=1667238921&sprefix=jbl+stage+39%2Caps%2C92&sr=8-1', '89,00', 0.0, 0, 0, 'JBL;Flush Montage;-;Koaxial;6.5 Zoll;-;JBL Lautsprecher Boxen Stage 3 637 F sind hocheffizient und leistungsstark, liefern einen tollen Sound und sind super Aufrüstung Einbaulautsprecher für jedes Auto-HiFi-Soundsystem, sogar bei werkseitig eingebaute Car Stereoanlagen mit geringer Leistung|Durch das 3-Ohm-DCR-Design holen die Harman Kardon Lautsprecher jedes Watt Leistung aus dem Verstärker, so dass sie eine saubere, resonanzfreie Klangqualität liefern um deine Musik in kristallklarer resonanzfreier Audioqualität wiederzugeben|Harman's Plus One-Auto-Subwoofer-membran-Technologie bietet eine 35% größere Box-Membranoberfläche als andere Auto Speaker, das den Wirkungsgrad um 2 dB Steigert und so für eine überragende Leistung und Performance der Bassbox sorgt|JBL Stage3 637F 3-Weg Autoboxen haben dank n Mid-Woofern und Dome Hochtöner, sehr präzise gleichmäßige Hoch- und Mitteltonwiedergabe, das heißt genießen vom Sound wie der Musikant es gemeint hat|Harman Kardon Auto Lautsprecher Boxen werden ausführlich getestet um sicher zu gehen das das Lautsprecher Auto Soundsystem die anspruchsvollen Hitze und Feuchtigkeit im Wagen standhält');
